(29299, 'F186E58E-DD7C-47DD-8375-6701E94CC951', 'I️ should have gone about the conversation in a different way. I’m sorry that we went to bed angry. I️t’s never happened before.', '593652506703663616', '593656217936584704', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'nitzan.pelman@gmail.com', '2019-10-24T16:28:26.703664'),
(29300, '90671CA2-4D72-4AF5-B307-26E16D47D347', 'I️ love you to pieces and am eager to not have a repeat of last night. We’re always going to have difficult moments. But how we handle them is always what’s made me want to keep investing in us.', '593652548144600192', '593656217936584704', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'nitzan.pelman@gmail.com', '2019-10-24T16:29:08.144600'),
