(29309, '19DE9F20-E6DE-496F-A515-21C8D598EC96', 'Hey love, I’m sorry for not being as responsive as I should be. I know this is something I need to still work on.....and I will. It seems to be a weird introvert tic that I have....and have passed on to Jonah!  I too didn’t sleep well and have felt discombobulated all day. I love you and don’t take one moment together for granted.  I look forward to having a bit of 1:1 time together this weekend....could really use it.  Enjoy tonight. I’m so proud of the work you are doing and the lives you are changing.', '593656747920723200', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'David', '2019-10-24T17:39:07.920723'),
